import React from "react";
// import { makeStyles } from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";
import GenericButton from "../../components/GenericButton/index.js";
import "./Email.css";
import { createMuiTheme, makeStyles } from "material-ui/styles";
import { yellow } from "@material-ui/core/colors";

const useStyles = makeStyles((theme) => ({
  root: {
    "& div.MuiTextField-root": {
      margin: theme.spacing(5),
      width: "50ch",
      display: "flex",
    },
    "& div.MuiInputBase-root": {
      borderRadius: "25px",
    },
    "& div.MuiFilledInput-underline:before": {
      borderBottom: "none",
    },
    "& div.MuiFilledInput-underline:after": {
      borderBottom: "none",
    },
  },
}));

const theme = createMuiTheme({
  palette: {
    primary: yellow,
  },
});

export default function BasicTextFields() {
  const classes = useStyles();
  return (
    // need div tags that enclose entire return statement
    <div className="layout">
      <h1>pls werk</h1>
      <form className={classes.root} noValidate autoComplete="off">
        <div className="partner">
          {/* <ThemeProvider theme={theme}> */}
          <TextField
            id="outlined-basic"
            label="Partner's Email"
            variant="filled"
          />
          {/* </ThemeProvider> */}
        </div>
        <div>
          <TextField
            id="outlined-multiline-static"
            label="Message"
            multiline
            rows={4}
            variant="filled"
          />
        </div>
      </form>
      <div>
        <GenericButton label="send" className=""></GenericButton>
        {/* does this button have to be part of the form?  */}
      </div>
    </div>
  );
}
